import {useDispatch,useSelector} from 'react-redux';

const PokemonList = ()=>{
    const dispatch = useDispatch();
    const PokemonList = useSelector(state=>state.PokemonList);
    return(
        <div>Pokemon List</div>
    )
}

export default PokemonList;
